Lezley Zen is an unappreciated wife and mother who decides to take some Yoga classes with her friend Judy to get her mind off her humdrum existence. She quickly learns, however, that her instructor Keiran, is a very touchy-feely kind of guy who wants to give Lezley a &quot;one-on-one session.&quot;
